INSERT INTO Exercise (id, name, difficulty, info, picture_path) VALUES
(1, 'Benchpress', 2, 'Lege dich flach auf eine Bank, die Füße fest auf dem Boden. Halte die Langhantel schulterbreit mit den Händen. Senke die Hantel langsam zur Mitte der Brust ab und drücke sie kontrolliert nach oben, bis die Arme gestreckt sind.', 'benchpress'),
(2, 'Dumbell-Benchpress', 3, 'Lege dich auf eine Flachbank und halte in jeder Hand eine Kurzhantel. Senke die Hanteln langsam seitlich zur Brust ab und drücke sie dann kontrolliert nach oben, bis die Arme gestreckt sind.', 'dumbell_benchpress'),
(3, 'Incline-Benchpress', 2, 'Setze die Bank auf eine leichte Neigung (ca. 30 Grad). Halte die Langhantel schulterbreit und senke sie langsam zur oberen Brust ab. Drücke die Hantel dann kontrolliert nach oben.', 'incline_benchpress'),
(4, 'Incline-Dumbell-Benchpress', 3, 'Setze die Bank auf eine leichte Neigung (ca. 30 Grad). Halte in jeder Hand eine Kurzhantel. Senke die Hanteln langsam seitlich zur oberen Brust ab und drücke sie dann kontrolliert nach oben.', 'incline_dumbell_benchpress'),
(5, 'Butterfly - Machine', 1, 'Setze dich an die Butterfly-Maschine, die Arme auf Brusthöhe an den Griffen. Drücke die Arme nach innen, bis sie sich vor dir berühren, und lasse sie langsam wieder nach außen zurück.', 'butterfly_maschine'),
(6, 'Dumbell-Flys', 2, 'Lege dich flach auf eine Bank und halte in jeder Hand eine Kurzhantel. Senke die Hanteln seitlich ab, bis die Arme fast gestreckt sind, und bringe sie dann in einer bogenförmigen Bewegung zurück nach oben.', 'dumbell_flys'),
(7, 'Cable Crossover', 1, 'Stelle dich zwischen zwei Kabelzüge, die Griffe auf Brusthöhe. Ziehe die Griffe in einer bogenförmigen Bewegung nach vorne zusammen und lasse sie kontrolliert zurück.', 'cable_crossover'),
(8, 'Chest-Press', 1, 'Setze dich an die Brustpresse, die Griffe auf Brusthöhe. Drücke die Griffe kontrolliert nach vorne, bis die Arme gestreckt sind, und lasse sie langsam zurück.', 'chest_press'),
(9, 'Dips', 3, 'Stütze dich an den parallelen Holmen ab, die Arme gestreckt. Senke den Körper langsam ab, indem du die Ellbogen beugst, bis die Brust leicht gedehnt wird. Drücke dich dann kontrolliert nach oben in die Ausgangsposition.', 'dips'),
(10, 'Pullups', 2, 'Fasse die Klimmzugstange schulterbreit oder etwas weiter. Ziehe dich hoch, bis dein Kinn über die Stange kommt, und lasse dich dann langsam und kontrolliert wieder herunter. Halte die Spannung im Rücken während der gesamten Bewegung.', 'pullups'),
(11, 'Lat-Pulldown', 1, 'Setze dich an den Latzug mit geradem Rücken. Fasse die Stange etwas breiter als schulterbreit. Ziehe die Stange zur Brust, ohne den Oberkörper zu weit nach hinten zu lehnen. Langsam zurückführen.', 'lat_pulldown'),
(12, 'Pullovers', 2, 'Lege dich auf eine Bank, halte eine Kurzhantel oder Langhantel über deinem Kopf. Senke das Gewicht langsam hinter den Kopf, bis du eine Dehnung im Latissimus spürst, und führe es dann wieder nach oben.', 'pullovers'),
(13, 'narrow Row - Barbell', 2, 'Stehe leicht gebeugt mit einem geraden Rücken. Fasse die Langhantel eng, ziehe sie zur unteren Brust oder zum Bauch, und senke sie langsam wieder ab. Achte darauf, den Rücken gerade zu halten.', 'narrow_row_barbell'),
(14, 'narrow T-Bar Row', 2, 'Stelle dich auf die T-Bar-Ruderplattform, halte den Griff eng. Ziehe den Griff in einer kontrollierten Bewegung zur unteren Brust, wobei der Rücken stabil bleibt. Langsam zurückführen.', 'narrow_t_bar_row'),
(15, 'narrow Row - Cable', 2, 'Setze dich an das Kabelzuggerät und greife den engen Griff. Ziehe den Griff kontrolliert zum unteren Brustkorb, während der Rücken aufrecht bleibt. Langsam wieder nach vorne führen.', 'narrow_row_cable'),
(16, 'narrow Row - Dumbells', 2, 'Beuge dich mit geradem Rücken leicht nach vorne. Halte eine Kurzhantel in jeder Hand und ziehe sie eng zur Taille. Kontrolliere die Abwärtsbewegung.', 'narrow_row_dumbells'),
(17, 'narrow Row - Machine', 1, 'Setze dich an die Rudermaschine mit engem Griff. Ziehe die Griffe zur Brust, während der Rücken stabil bleibt. Führe die Griffe langsam und kontrolliert zurück.', 'narrow_row_maschine'),
(18, 'wide Row - Barbell', 3, 'Beuge dich mit geradem Rücken nach vorne und greife die Langhantel weit. Ziehe die Hantel zur Brust oder zum oberen Bauch, und senke sie langsam ab. Halte die Schultern stabil.', 'wide_row_barbell'),
(19, 'wide T-Bar Row', 2, 'Stelle dich auf die T-Bar-Plattform und greife den Griff weit. Ziehe den Griff kontrolliert zum oberen Brustkorb und senke ihn langsam ab. Achte auf eine stabile Rumpfhaltung.', 'wide_t_bar_row'),
(20, 'wide Machine-Row', 1, 'Setze dich an die Rudermaschine mit breitem Griff. Ziehe die Griffe kontrolliert zur Brust und führe sie langsam zurück. Halte den Rücken gerade.', 'wide_maschine_row'),
(21, 'wide Row - Dumbells', 2, 'Beuge dich mit geradem Rücken leicht nach vorne. Halte eine Kurzhantel in jeder Hand mit weitem Griff. Ziehe die Hanteln seitlich zur Brust und senke sie langsam ab.', 'wide_row_dumbells'),
(22, 'wide Row - Cable', 1, 'Setze dich an das Kabelzuggerät und greife die breite Stange. Ziehe die Stange kontrolliert zur Brust und lasse sie langsam zurückgleiten.', 'wide_row_cable'),
(23, 'Hyperextensions', 2, 'Positioniere dich auf einer Hyperextensions-Bank mit den Hüften auf dem Polster. Senke den Oberkörper langsam ab und richte ihn kontrolliert wieder auf. Halte den Rücken stets gerade.', 'hyperextensions'),
(24, 'Good Mornings', 2, 'Stehe aufrecht mit einer Langhantel auf den Schultern. Beuge die Hüften nach vorne, während der Rücken gerade bleibt. Kehre kontrolliert in die Ausgangsposition zurück.', 'good_mornings'),
(25, 'Lower Back - Machine', 1, 'Setze dich an die Rückentrainingsmaschine und lehne dich an das Polster. Drücke das Polster nach hinten, um den unteren Rücken zu trainieren. Langsam zurückführen.', 'lower_back_maschine'),
(26, 'Adduktor - Machine', 1, 'Setze dich an die Adduktoren-Maschine und positioniere die Beine so, dass sie gegen die Polster gedrückt sind. Führe die Beine kontrolliert zusammen, spanne die Innenschenkelmuskulatur an und lasse sie langsam in die Ausgangsposition zurück.', 'adduktor_maschine'),
(27, 'Abduktor - Machine', 1, 'Setze dich an die Abduktoren-Maschine und positioniere die Beine so, dass die Außenseiten gegen die Polster drücken. Drücke die Beine kontrolliert nach außen und lasse sie langsam zurück in die Ausgangsposition.', 'abduktor_maschine'),
(28, 'Hip-Thrust', 2, 'Setze dich mit dem Rücken auf eine Bank, die Langhantel liegt auf deinem Becken. Drücke das Becken nach oben, spanne dabei Gesäß und Core an, und senke es langsam wieder ab.', 'hip_thrust'),
(29, 'Lunges', 2, 'Stehe aufrecht, mache einen weiten Schritt nach vorne und senke das hintere Knie kontrolliert Richtung Boden. Drücke dich aus dem vorderen Bein zurück in die Ausgangsposition.', 'lunges'),
(30, 'Kickbacks', 1, 'Stelle dich an den Kabelzug mit einer Fußschlaufe. Schiebe das Bein gestreckt nach hinten, während du den Core stabil hältst. Kehre kontrolliert in die Ausgangsposition zurück.', 'kickbacks'),
(31, 'Split-Squats', 3, 'Setze einen Fuß auf eine erhöhte Fläche hinter dir. Senke das hintere Knie Richtung Boden, während das vordere Bein die Last trägt. Drücke dich kontrolliert nach oben.', 'split_squats'),
(32, 'Calf-Raises - standing', 1, 'Stelle dich aufrecht hin, die Füße schulterbreit. Hebe die Fersen so hoch wie möglich, spanne die Waden an, und senke die Fersen langsam wieder ab.', 'calf_raises_standing'),
(33, 'Calf-Raises - seated', 1, 'Setze dich an die Wadenmaschine, die Polster liegen auf den Oberschenkeln. Hebe die Fersen so hoch wie möglich, spanne die Waden an, und senke die Fersen langsam wieder ab.', 'calf_raises_seated'),
(34, 'Tibialis Raises', 1, 'Lehne dich mit dem Rücken an eine Wand, die Füße leicht nach vorne versetzt. Hebe die Zehen Richtung Schienbein, spanne die vordere Schienbeinmuskulatur an, und senke sie langsam wieder ab.', 'tibialis_raises'),
(35, 'romanian Deadlift', 3, 'Stehe aufrecht mit einer Langhantel in den Händen. Beuge die Hüften nach hinten, während der Rücken gerade bleibt und die Hantel entlang der Beine nach unten geführt wird. Kehre kontrolliert in die Ausgangsposition zurück.', 'rumanian_deadlift'),
(36, 'Leg-Curls - seated', 1, 'Setze dich an die Beincurl-Maschine, die Polster liegen über den Knöcheln. Beuge die Knie, um die Polster nach unten zu ziehen, und kehre langsam in die Ausgangsposition zurück.', 'leg_curls_seated'),
(37, 'Leg-Curls - laying', 1, 'Lege dich auf die Bauchlage der Beincurl-Maschine. Beuge die Knie, um die Polster nach oben zu ziehen, und kehre langsam in die Ausgangsposition zurück.', 'leg_curls_laying'),
(38, 'Leg-Curls - standing', 1, 'Stelle dich an die stehende Beincurl-Maschine und fixiere einen Fuß. Beuge das Knie, um das Polster nach hinten oben zu ziehen, und kehre kontrolliert zurück.', 'leg_curls_standing'),
(39, 'Squats - Barbell', 3, 'Platziere die Langhantel auf den Schultern, stehe schulterbreit. Beuge die Knie, senke die Hüften nach unten, bis die Oberschenkel parallel zum Boden sind, und drücke dich kontrolliert nach oben.', 'squats_barbell'),
(40, 'Hack-Squats', 3, 'Positioniere dich auf der Hackenschmidt-Maschine, die Füße schulterbreit. Senke die Plattform, indem du die Knie beugst, und drücke sie kontrolliert nach oben.', 'hack_squats'),
(41, 'Gobletsquats', 2, 'Halte eine Kurzhantel vor der Brust. Senke die Hüften nach unten, bis die Oberschenkel parallel zum Boden sind, und drücke dich wieder nach oben.', 'gobletsquats'),
(42, 'Leg-Extension', 1, 'Setze dich an die Beinstreck-Maschine, die Polster liegen über den Schienbeinen. Strecke die Beine nach oben und kehre kontrolliert zurück.', 'leg_extension'),
(43, 'Leg-Press', 2, 'Setze dich an die Beinpresse, die Füße schulterbreit auf der Plattform. Drücke die Plattform nach oben, ohne die Knie komplett zu strecken, und senke sie langsam ab.', 'leg_press'),
(44, 'Tricep-Pushdowns', 1, 'Stelle dich an den Kabelzug mit einem geraden oder V-Griff. Drücke den Griff kontrolliert nach unten, bis die Arme vollständig gestreckt sind, und führe ihn langsam zurück.', 'tricep_pushdowns'),
(45, 'narrow Benchpress - Barbell', 1, 'Fasse die Langhantel eng, etwa schulterbreit. Senke die Hantel langsam zur Brust und drücke sie kontrolliert nach oben, um den Trizeps gezielt zu belasten.', 'narrow_benchpress_barbell'),
(46, 'Dips', 3, 'Greife die Dip-Stangen, stütze dich hoch. Beuge die Arme und senke den Körper, bis die Oberarme parallel zum Boden sind, und drücke dich kontrolliert nach oben.', 'dips'),
(47, 'Overhead-Tricep-Extension', 1, 'Halte eine Kurzhantel mit beiden Händen hinter dem Kopf. Strecke die Arme langsam nach oben und beuge sie kontrolliert wieder nach unten.', 'overhead_tricep_extension'),
(48, 'Skullcrushers', 2, 'Lege dich mit einer SZ-Stange auf die Bank. Senke die Stange kontrolliert zur Stirn und strecke die Arme wieder nach oben. Halte die Ellbogen stabil.', 'skullcrushers'),
(49, 'Preacher Curls - Machine', 1, 'Setze dich an die Bizeps-Maschine. Drücke die Griffe kontrolliert nach oben und lasse sie langsam wieder zurück.', 'preacher_curls_maschine'),
(50, 'Preacher Curls - Barbell', 2, 'Lege die Oberarme auf die Preacher-Bank und halte eine Langhantel. Hebe die Hantel kontrolliert an und senke sie langsam ab.', 'preacher_curls_barbell'),
(51, 'Preacher Curls - Cable', 1, 'Positioniere dich an der Kabelmaschine mit einer Preacher-Bank. Ziehe das Kabel kontrolliert nach oben und lasse es langsam zurück.', 'preacher_curls_cable'),
(52, 'Preacher Curls - Dumbells', 2, 'Lege die Oberarme auf die Preacher-Bank und halte je eine Kurzhantel. Hebe die Hanteln kontrolliert an und senke sie langsam ab.', 'preacher_curls_dumbells'),
(53, 'Curls - Dumbells', 1, 'Halte in jeder Hand eine Kurzhantel. Beuge die Arme abwechselnd oder gleichzeitig, spanne den Bizeps an, und lasse sie kontrolliert zurück.', 'curls_dumbells'),
(54, 'Curls - Barbell', 1, 'Halte eine Langhantel mit schulterbreitem Griff. Beuge die Arme, spanne den Bizeps an, und senke die Hantel langsam ab.', 'curls_barbell'),
(55, 'Curls - Cable', 1, 'Positioniere dich an der Kabelmaschine mit geradem Griff. Beuge die Arme, ziehe den Griff kontrolliert nach oben, und lasse ihn langsam zurück.', 'curls_cable'),
(56, 'Curls behind the Back - Dumbells', 1, 'Halte eine Kurzhantel hinter deinem Rücken. Beuge den Arm kontrolliert nach oben und senke ihn langsam ab.', 'curls_behind_the_back_dumbells'),
(58, 'Curls behind the Back - Cable', 1, 'Stelle dich seitlich an den Kabelzug. Ziehe den Griff hinter deinem Rücken nach oben und lasse ihn langsam zurück.', 'curls_behind_the_back_cable'),
(59, 'Hammercurls - Cable', 1, 'Halte den Griff am Kabelzug im Hammergriff (neutral). Ziehe den Griff kontrolliert nach oben und senke ihn langsam ab.', 'hammercurls_cable'),
(60, 'Hammercurls - Dumbells', 1, 'Halte eine Kurzhantel in jeder Hand im neutralen Griff. Beuge die Arme gleichzeitig oder abwechselnd und lasse sie kontrolliert zurück.', 'hammercurls_dumbells'),
(61, 'Forearm-Curls - Flexion', 1, 'Setze dich mit einer Langhantel auf den Oberschenkeln. Rolle die Hantel mit den Handgelenken nach oben, spanne die Unterarme an, und lasse sie langsam zurück.', 'forearm_curls_flexion'),
(62, 'Forearm-Curls - Extension', 1, 'Setze dich mit einer Langhantel auf den Oberschenkeln, die Handflächen nach unten. Rolle die Hantel mit den Handgelenken nach oben und lasse sie kontrolliert zurück.', 'forearm_curls_extension'),
(63, 'Forearm-Curls - neutral', 1, 'Halte eine Kurzhantel im neutralen Griff. Beuge das Handgelenk langsam nach oben und lasse es kontrolliert zurück.', 'forearm_curls_neutral'),
(64, 'Farmers-Walk', 1, 'Halte in jeder Hand eine schwere Kurzhantel. Gehe aufrecht, spanne den Core an, und halte die Gewichte stabil.', 'farmers_walk'),
(65, 'Reverse-Curls - Dumbell', 1, 'Halte eine Kurzhantel mit dem Handrücken nach oben. Beuge die Arme langsam und senke die Hantel kontrolliert ab.', 'reverse_curls_dumbell'),
(66, 'Reverse-Curls - Barbell', 1, 'Halte eine Langhantel mit dem Handrücken nach oben. Beuge die Arme langsam und senke die Hantel kontrolliert ab.', 'reverse_curls_barbell'),
(67, 'Lateral Raises - Machine', 1, 'Setze dich an die Maschine für seitliches Schulterheben. Drücke die Arme seitlich nach oben, bis sie auf Schulterhöhe sind, und senke sie langsam wieder ab.', 'lateral_raises_maschine'),
(68, 'Lateral Raises - Cable', 2, 'Stehe seitlich am Kabelzug, halte den Griff mit einer Hand. Ziehe den Arm seitlich nach oben bis auf Schulterhöhe und führe ihn langsam zurück.', 'lateral_raises_cable'),
(69, 'Lateral Raises - Dumbells', 3, 'Stehe aufrecht, halte in jeder Hand eine Kurzhantel. Hebe die Arme seitlich nach oben bis auf Schulterhöhe und senke sie langsam wieder ab.', 'lateral_raises_dumbells'),
(70, 'Upright-Rows', 3, 'Halte eine Langhantel mit schmalem Griff. Ziehe die Hantel eng am Körper nach oben, bis die Ellbogen auf Schulterhöhe sind, und senke sie langsam ab.', 'upright_rows'),
(71, 'Reverse Flies - Machine', 1, 'Setze dich an die Reverse-Flies-Maschine, die Brust gegen das Polster gedrückt. Ziehe die Arme nach hinten, bis sie auf Schulterhöhe sind, und lasse sie langsam zurück.', 'reverse_flies_maschine'),
(72, 'Reverse Flies - Cable', 2, 'Positioniere dich zwischen zwei Kabelzügen mit den Griffen in den Händen. Ziehe die Arme in einer umgekehrten Fliegbewegung nach hinten und führe sie kontrolliert zurück.', 'reverse_flies_cable'),
(73, 'Reverse Flies - Dumbells', 3, 'Beuge den Oberkörper nach vorne, halte in jeder Hand eine Kurzhantel. Ziehe die Arme seitlich nach oben, bis sie auf Schulterhöhe sind, und senke sie langsam wieder ab.', 'reverse_flies_dumbells'),
(74, 'Face-Pulls', 2, 'Stelle dich an den Kabelzug mit einem Seilgriff auf Brusthöhe. Ziehe das Seil Richtung Gesicht, halte die Ellbogen hoch, und lasse es kontrolliert zurück.', 'face_pulls'),
(75, 'Shoulderpress-Machine', 1, 'Setze dich an die Schulterdrück-Maschine, die Griffe auf Höhe der Schultern. Drücke die Griffe kontrolliert nach oben und lasse sie langsam wieder zurück.', 'shoulderpress_maschine'),
(76, 'Dumbell-Shoulderpress', 3, 'Setze dich mit aufrechter Haltung, halte in jeder Hand eine Kurzhantel auf Schulterhöhe. Drücke die Hanteln nach oben, bis die Arme gestreckt sind, und senke sie langsam ab.', 'dumbell_shoulderpress'),
(77, 'Shoulderpress-Barbell', 2, 'Halte eine Langhantel auf Schulterhöhe, die Füße schulterbreit. Drücke die Hantel nach oben über den Kopf, bis die Arme gestreckt sind, und senke sie langsam ab.', 'shoulderpress_barbell'),
(78, 'Frontraises', 1, 'Stehe aufrecht, halte eine Kurzhantel in jeder Hand. Hebe die Hanteln vor dir nach oben, bis sie auf Schulterhöhe sind, und senke sie langsam ab.', 'frontraises'),
(79, 'Overheadpress', 3, 'Halte die Langhantel auf Schulterhöhe, die Füße schulterbreit. Drücke die Hantel über den Kopf, bis die Arme gestreckt sind, und senke sie kontrolliert zurück.', 'overheadpress'),
(80, 'Shrugs', 1, 'Halte in jeder Hand eine Kurzhantel, die Arme hängen seitlich. Ziehe die Schultern so weit wie möglich nach oben, spanne den Nacken an, und lasse sie langsam wieder herunter.', 'shrugs'),
(81, 'Neck-Curls', 2, 'Lege dich auf eine Bank mit dem Kopf über der Kante. Halte ein leichtes Gewicht an der Stirn, hebe den Kopf nach oben, und senke ihn langsam ab.', 'neck_curls'),
(82, 'Leg-Raises', 1, 'Hänge dich an eine Stange, die Arme gestreckt. Hebe die Beine gestreckt nach oben, spanne die Bauchmuskeln an, und senke sie kontrolliert wieder ab.', 'leg_raises'),
(83, 'Abs-Machine', 1, 'Setze dich an die Bauchmaschine, die Griffe auf Schulterhöhe. Beuge den Oberkörper nach vorne, spanne die Bauchmuskeln an, und lasse ihn langsam zurück.', 'abs_maschine'),
(84, 'Cable-Crunches', 2, 'Knie dich vor den Kabelzug mit einem Seilgriff. Ziehe das Seil nach unten, während du den Oberkörper einrollst und die Bauchmuskeln anspannst.', 'cable_crunches'),
(85, 'Dumbbell-Side-Bend', 1, 'Stelle dich aufrecht hin, eine Hantel in einer Hand. Beuge den Oberkörper zur Seite, spanne die seitlichen Bauchmuskeln an, und richte dich kontrolliert wieder auf.', 'dumbbell_side_bend'),
(86, 'Abs-Rotation', 1, 'Bei den Abs Rotations am Kabelzug drehst du den Oberkörper kontrolliert vom Kabelzug weg, während die Hüften stabil bleiben. Die Arme sind leicht gebeugt, aber die Kraft kommt aus der Rumpfmuskulatur. Anschließend kehrst du langsam in die Ausgangsposition zurück, ohne Schwung zu holen.', 'abs_rotation');
